import React from 'react';
import {ThemeProvider} from "@material-ui/styles";

import theme from './Theme';
import LandingPage from "./LandingPage";

function App() {
  return (
    <ThemeProvider theme={theme}>
      <LandingPage />
    </ThemeProvider>
  );
}

export default App;
